sub_tasks.description:
Create/modify middleware so that it has access to both the request and the final response.
Pseudo-code (.NET 8):
```
app.Use(async (ctx, next) =>
{
   var act = Activity.Current;
   // 3.1  Capture Referer immediately
   var referer = ctx.Request.Headers["Referer"].FirstOrDefault();
   if (!string.IsNullOrEmpty(referer))
       act?.SetTag("HTTP_REFERER", referer);

   // 3.2  Capture redirect location after response
   ctx.Response.OnStarting(() =>
   {
       if (ctx.Response.StatusCode >= 300 && ctx.Response.StatusCode < 400)
       {
           var loc = ctx.Response.Headers["Location"].FirstOrDefault();
           if (!string.IsNullOrEmpty(loc))
               act?.SetTag("HTTP_RESPONSE_REDIRECT_LOCATION", loc);
       }
       return Task.CompletedTask;
   });

   await next();
});
```
• Add null-safety and sanitisation.
• Register earlier than `app.UseRouting()` so the Activity exists.

