	public class CoreDomainRegistry : ServiceRegistry
	{
		internal const string StorageHttpClientName = "storageHttpClient";
		internal const string DmsMetadataHttpClientName = "dmsMetadataHttpClient";
		private readonly string _oneConfigPath;

		public CoreDomainRegistry()
		{
			_oneConfigPath = Path.GetDirectoryName(Assembly.GetExecutingAssembly().Location);
		}

		public CoreDomainRegistry(string oneConfigPath)
		{
			_oneConfigPath = oneConfigPath;
		}

		protected override void PopulateRegistry(Registry registry)
		{
			PopulatePersistenceRegistries(registry);
			PopulateRepositoryRegistries(registry);
			PopulateOtherRegistries(registry);
			PopulateOneConfigRegistry(registry, _oneConfigPath);
		}

		protected override void PopulateServiceRegistry(IServiceCollection services)
		{
			services.TryAddSingleton(TimeProvider.System);
			services.AddHttpClient();
			services.AddHttpClient(DmsMetadataHttpClientName)
					.ConfigurePrimaryHttpMessageHandler(() => new HttpClientHandler
					{
						AutomaticDecompression = DecompressionMethods.GZip | DecompressionMethods.Deflate
					});

			// Add storage http client
			services.AddHttpClient(StorageHttpClientName,
				client =>
				{
					client.Timeout = Timeout.InfiniteTimeSpan;
				})
				.SetHandlerLifetime(TimeSpan.FromMinutes(5));

			// Add workflow v1 grpc client
			services.AddHttpClient<WorkflowV1GrpcClient>()
#if NETFRAMEWORK
				// Enable trace propagation for .net 4.8, which is using WinHttpHandler
				.AddHttpMessageHandler<OpenTelemetryDelegatingHandler>()
#endif
				.ConfigurePrimaryHttpMessageHandler(
					_ =>
					{
#if NET
						if (SocketsHttpHandler.IsSupported)
						{
							return new SocketsHttpHandler { EnableMultipleHttp2Connections = true };
						}
#endif
#if NETFRAMEWORK
						return new WinHttpHandler { EnableMultipleHttp2Connections = true };
#else
						return new HttpClientHandler();
#endif
					});

			services.AddTransient<IWorkflowV1GrpcMapper, WorkflowV1GrpcMapper>();
			services.AddSingleton<IWorkflowV1GrpcClientFactory, WorkflowV1GrpcClientFactory>();
			ADEXS.Core.Domain.ComponentsInstrumentationRegistrationExtensions.AddComponentsInstrumentation(services);

			services.AddTransient<ICompressedJsonSerializer, CompressedJsonSerializer>();

			services.AddTransient<WorkflowConversionJsonSerializer>();
			services.AddTransient<WorkflowConversionBinarySerializer>();
			services.AddTransient<IWorkflowConversionSerializerFactory>(
				sp => new WorkflowConversionSerializerFactory(
					sp.GetRequiredService<WorkflowConversionJsonSerializer>(),
					sp.GetRequiredService<WorkflowConversionBinarySerializer>(),
					sp.GetRequiredService<IWatchedSingletonConfig<IWorkflowConversionInvariantConfig>>()));

			new ContentStorageRegistry().ConfigureServiceCollection(services);
			new AccountBrandingRegistry(_oneConfigPath).ConfigureServiceCollection(services);
			new CoreServiceRegistry(_oneConfigPath).ConfigureServiceCollection(services);

			services.AddTransient<IInboundEmailPersistence, InboundEmailPersistence>();

			services.AddCoreGrpcClientFactoryOptions<GrpcClientFactoryOptions>();
			services.AddCoreGrpcCallContextPropogator<GrpcCallContextPropagator>();
			services.AddCoreGrpcClientFactory<GrpcClientFactoryMicroserviceOptions>();
			PopulateGrpcClientActivatorDependencies(services);
		}

		private void PopulateGrpcClientActivatorDependencies(IServiceCollection services)
		{
			services.AddGenericClientActivator<CheckAlive.CheckAliveClient>();
			services.AddGenericClientActivator<ClmDocumentUploadService.ClmDocumentUploadServiceClient>();
			services.AddGenericClientActivator<ClmProcessingStatusService.ClmProcessingStatusServiceClient>();
			services.AddGenericClientActivator<DataPlacementService.DataPlacementServiceClient>();
			services.AddGenericClientActivator<DcfFeedbackService.DcfFeedbackServiceClient>();
			services.AddGenericClientActivator<EventService.EventServiceClient>();
			services.AddGenericClientActivator<ExtractionTypesService.ExtractionTypesServiceClient>();
			services.AddGenericClientActivator<RateLimitService.RateLimitServiceClient>();
			services.AddGenericClientActivator<TransformService.TransformServiceClient>();
			services.AddGenericClientActivator<IngestionService.IngestionServiceClient>();
		}

