using OpenTelemetry.Metrics;

var builder = ScmWebApplication.CreateScmWebService(args);

builder.ConfigureDefaultScmWebService(
	args,
	() => new List<IServiceRegistry>
	{
		new CoreServiceRegistry(),
		new CoreWorkflowRegistry(),
		new AtlasWorkflowReadersRegistry(),
		new MessageQueueRegistry(),
		new SmallBenClientRegistry(),
		new CoreDomainRegistry(),
		new EtlRegistry(),
		new ESignatureRegistry(),
		new SalesForceRegistry(),
		new MergeEngineServiceRegistry(),
		new AtlasWorkflowActivitiesRegistry(),
		new OrchestrationIntegrationRegistry()
	},
	WorkflowActivitiesConstants.ServiceName,
	configureMeter: options =>
	{
		options.AddView(instrumentName: "workflowactivities.api.duration",
			new ExplicitBucketHistogramConfiguration
			{
				Boundaries = new double[] { 10, 25, 50, 100, 200, 500, 1000, 2000, 5000, 10000 }
			});
	},
	appConfigFileName: "WorkflowActivitiesApiConfig.ini");

builder.Services.AddWebCoreBasedConfigProviders();

// We only enable JwtAuth when on-prem due to MSF -> onprem communication
if (ApplicationSettings.EnvironmentType == EnvironmentType.OnPrem)
{
	builder.Services.AddAuthentication(JwtBearerDefaults.AuthenticationScheme)
	.AddJwtBearer(options =>
	{
		options.RequireHttpsMetadata = builder.Configuration.GetValue<bool>("Jwt_PublicKeyRequireHttps", true);
		options.Authority = new DocuSignAccountsServerUrl().AuthorityUrl();
#pragma warning disable CA5404 // Do not disable token validation checks
		options.TokenValidationParameters = new TokenValidationParameters { ValidateAudience = false };
#pragma warning restore CA5404 // Do not disable token validation checks
	});
	builder.Services.AddAuthorization(options =>
	{
		options.AddPolicy(ADEXS.Core.Types.Constants.WorkflowActivitiesApi.ScopePolicyName, policy =>
			policy.RequireClaim(
				ADEXS.Core.Types.Constants.WorkflowActivitiesApi.ScopeClaimKey,
				ADEXS.Core.Types.Constants.DocuSignAuthenticationScopes.ClmActivitiesExecute));
		options.DefaultPolicy = options.GetPolicy(ADEXS.Core.Types.Constants.WorkflowActivitiesApi.ScopePolicyName);
	});
}
else
{
	builder.Services.AddAuthentication();
	builder.Services.AddAuthorization(options =>
	{
		options.AddPolicy(ADEXS.Core.Types.Constants.WorkflowActivitiesApi.AllowAllPolicyName, policy =>
			policy.Requirements.Add(new AllowAnonymousRequirement()));
		options.DefaultPolicy = options.GetPolicy(ADEXS.Core.Types.Constants.WorkflowActivitiesApi.AllowAllPolicyName);
	});
	builder.Services.AddSingleton<IAuthorizationHandler, AllowAnonymousHandler>();
}

builder.Services.AddWorkflowActivitiesServices();

builder.Services.AddMvc(options =>
{
	options.Filters.Add(new GlobalActionFilter());
	options.Filters.Add(new AuditedRequestAttribute());
	options.Filters.Add(new WorkflowActivitiesExceptionFilterAttribute());
});

// Do not remove -- this is required for proper deserialization of InstanceVariables
builder.Services.AddControllers().AddNewtonsoftJson();
builder.Services.AddEndpointsApiExplorer();

builder.Services.AddSwaggerGen(options =>
{
	options.CustomOperationIds(c => $"{c.ActionDescriptor.RouteValues["action"]}");
	options.SupportNonNullableReferenceTypes();
	options.UseAllOfForInheritance();
	options.SwaggerDoc(WorkflowActivitiesConstants.ServiceVersion, new OpenApiInfo
	{
		Title = WorkflowActivitiesConstants.ServiceName,
		Version = WorkflowActivitiesConstants.ServiceVersion
	});
	options.DocumentFilter<PathFormatDocumentFilter>();
	options.SchemaFilter<EnumNameSchemaFilter>();
});

builder.Services.AddSwaggerGenNewtonsoftSupport();

builder.Services.AddSingleton<IMetricsEmitter, WorkflowActivitiesMetricsEmitter>();

builder.Services.AddHttpClient();

builder.Services.AddComponentsInstrumentation();

var app = builder.Build();

if (app.Environment.IsDevelopment())
{
	IdentityModelEventSource.ShowPII = true;
}

app.UseCommonScmServices();

app.UseMiddleware<LogRequestHttpMiddleware>();

app.UseAuthentication();
app.UseAuthorization();

app.UseSwagger();
app.UseSwaggerUI();

app.UseStaticFiles();
app.UseStaticFiles($"/{WorkflowActivitiesConstants.ServiceUrlPrefixNoTrailingSlash}");

app.MapServiceHealthChecks();
app.MapVersionEndpoint($"{WorkflowActivitiesConstants.ServiceUrlPrefix}version");
app.MapVersionEndpoint($"{WorkflowActivitiesConstants.ServiceVersion}/version");
app.MapControllers();

app.RunScmWebService();

