using Moq;

using NUnit.Framework;

namespace ADEXS.Core.Domain.Tests.Utilities;

[Category("Unit")]
[TestFixture]
public class ActivityEnricherTests : IDisposable
{
	private ActivitySource _activitySource = new ActivitySource("ActivityEnricherTests");
	private ActivityListener _activityListener;
	private bool _disposedValue;

	[NUnit.Framework.OneTimeSetUp]
	public void SetupTests()
	{
		_activityListener = new ActivityListener()
		{
			ShouldListenTo = (source) => true,
			Sample = (ref ActivityCreationOptions<ActivityContext> options) => ActivitySamplingResult.AllDataAndRecorded,
			SampleUsingParentId = (ref ActivityCreationOptions<string> activityOptions) => ActivitySamplingResult.AllData,
			ActivityStarted = activity => Trace.TraceInformation("Started: {0,-15} {1,-60}", activity.OperationName, activity.Id),
			ActivityStopped = activity => Trace.TraceInformation("Stopped: {0,-15} {1,-60} {2,-15}", activity.OperationName, activity.Id, activity.Duration)
		};

		ActivitySource.AddActivityListener(_activityListener);
	}

	[NUnit.Framework.TearDown]
	public void TeardownTest()
	{
		AtlasContext.Reset();
	}

	[TestCase(true)]
	[TestCase(false)]
	public void ActivityEnrichWithoutAtlasContextAndServiceContextDoesNotSetTags(bool emitSessionTag)
	{
		var context = GetHttpContext(emitSessionTag);
		using var activity = _activitySource.CreateActivity("Test", ActivityKind.Server);

		activity.SetTagsWithCommonFields(context);

		Assert.IsFalse(activity.TagObjects.Exists(p => p.Key == TraceSemanticConventions.AttributeDocuSignAccountId));
		Assert.IsFalse(activity.TagObjects.Exists(p => p.Key == TraceSemanticConventions.AttributeDocuSignUserId));
		Assert.AreEqual(activity.TagObjects.Exists(p => p.Key == OtelSemanticConventions.SessionId), emitSessionTag);
	}

	[TestCase(true)]
	[TestCase(false)]
	public void ActivityEnrichWithAtlasContextWithoutServiceSetsTags(bool emitSessionTag)
	{
		var _userAccount = CoreDomainUnitTestFixtures.CreateUserAccount();
		var context = GetHttpContext(emitSessionTag);
		using var activity = _activitySource.CreateActivity("Test", ActivityKind.Server);

		activity.SetTagsWithCommonFields(context);

		Assert.IsTrue(activity.TagObjects.Exists(p => p.Key == TraceSemanticConventions.AttributeDocuSignAccountId));
		Assert.IsTrue(activity.TagObjects.Exists(p => p.Key == TraceSemanticConventions.AttributeDocuSignUserId));
		Assert.AreEqual(activity.TagObjects.Exists(p => p.Key == OtelSemanticConventions.SessionId), emitSessionTag);
	}

	[TestCase(true)]
	[TestCase(false)]
	public void ActivityEnrichWithoutAtlasContextWithServiceContextSetsTags(bool emitSessionTag)
	{
		using (var testLogger = new TestLogger(Guid.NewGuid(), "Test"))
		{
			var _userAccount = CoreDomainUnitTestFixtures.CreateUserAccount();

			ServiceContext.LogDataPoint(DataPoint.UserId, _userAccount.Uid);
			ServiceContext.LogDataPoint(DataPoint.AccountId, _userAccount.AccountId);
			AtlasContext.Reset();
			var context = GetHttpContext(emitSessionTag);
			using var activity = _activitySource.CreateActivity("Test", ActivityKind.Server);

			activity.SetTagsWithCommonFields(context);

			Assert.IsTrue(activity.TagObjects.Exists(p => p.Key == TraceSemanticConventions.AttributeDocuSignAccountId));
			Assert.IsTrue(activity.TagObjects.Exists(p => p.Key == TraceSemanticConventions.AttributeDocuSignUserId));
			Assert.AreEqual(activity.TagObjects.Exists(p => p.Key == OtelSemanticConventions.SessionId), emitSessionTag);
		}
	}

	[TestCase(true)]
	[TestCase(false)]
	public void ActivityEnrichWithAtlasContextAndServiceContextAtlasContextSetsTags(bool emitSessionTag)
	{
		using (var testLogger = new TestLogger(Guid.NewGuid(), "Test"))
		{
			var _userAccount = CoreDomainUnitTestFixtures.CreateUserAccount();

			ServiceContext.LogDataPoint(DataPoint.UserId, Guid.NewGuid());
			ServiceContext.LogDataPoint(DataPoint.AccountId, int.MaxValue);
			var context = GetHttpContext(emitSessionTag);
			using var activity = _activitySource.CreateActivity("Test", ActivityKind.Server);

			activity.SetTagsWithCommonFields(context);

			var atlasAcctId = activity.TagObjects.First(p => p.Key == TraceSemanticConventions.AttributeDocuSignAccountId).Value;
			var atlasUserId = activity.TagObjects.First(p => p.Key == TraceSemanticConventions.AttributeDocuSignUserId).Value;

			Assert.AreEqual(_userAccount.AccountId, atlasAcctId);
			Assert.AreEqual(_userAccount.Uid, atlasUserId);
			Assert.AreEqual(activity.TagObjects.Exists(p => p.Key == OtelSemanticConventions.SessionId), emitSessionTag);
		}
	}


#if NETFRAMEWORK
	private HttpContext GetHttpContext(bool wireUpSession)
	{
		var context = new HttpContext(new HttpRequest("", "http://dummy", ""), new HttpResponse(new StringWriter()));
		if (wireUpSession)
		{
			WireUpSession(context);
		}
		return context;
	}

	private static void WireUpSession(HttpContext context)
	{
		var sessionContainer = new HttpSessionStateContainer(
			"id",
			new SessionStateItemCollection(),
			new HttpStaticObjectsCollection(),
			10,
			true,
			HttpCookieMode.AutoDetect,
			SessionStateMode.InProc,
			false);

		SessionStateUtility.AddHttpSessionStateToContext(context, sessionContainer);
	}
#else
	private static HttpContext GetHttpContext(bool wireUpSession)
	{
		var context = new Mock<HttpContext>();
		if (wireUpSession)
		{
			WireUpSession(context);
		}
		return context.Object;
	}

	private static void WireUpSession(Mock<HttpContext> context)
	{
		var mockIFeatureCollection = new Mock<IFeatureCollection>();
		mockIFeatureCollection.Setup(p => p.Get<ISessionFeature>())
			.Returns(new SessionFeature());
		context.Setup(p => p.Features).Returns(mockIFeatureCollection.Object);

		var session = new Mock<ISession>();
		session.Setup(p => p.Id).Returns(Guid.NewGuid().ToString());
		context.Setup(p => p.Session).Returns(session.Object);
	}
#endif

	protected virtual void Dispose(bool disposing)
	{
		if (!_disposedValue)
		{
			if (disposing)
			{
				_activitySource?.Dispose();
				_activityListener?.Dispose();
			}

			_disposedValue = true;
		}
	}

	public void Dispose()
	{
		// Do not change this code. Put cleanup code in 'Dispose(bool disposing)' method
		Dispose(disposing: true);
		GC.SuppressFinalize(this);
	}

	protected class TestLogger : AsyncRequestEventLogger
	{
		public TestLogger(Guid? correlationToken, string action) : base(correlationToken, action)
		{
		}

		protected override TimingEventSource LoggerTimer => null;


		[EventSource("Tasks", "CLM.Service")]
		[Counter("Tasks", "CLM.Service")]
		internal static RequestEventSource _clmEventSource = new RequestEventSource();

		protected override RequestEventSource LoggerEventSource => _clmEventSource;
	}
}

