namespace ADEXS.Web.DotVVM.Controls.Adapters;
public class HtmlLink : AtlasHtmlGenericControl, IHtmlLink
{
	public HtmlLink() : base(HtmlTextWriterTag.Link) { }

	public string Href
	{
		get { return (string)GetValue(HrefProperty); }
		set { SetValue(HrefProperty, value); }
	}
	public static readonly DotvvmProperty HrefProperty
		= DotvvmProperty.Register<string, HtmlLink>(c => c.Href);

	protected override void OnPreRender(IDotvvmRequestContext context)
	{
		base.OnPreRender(context);
		this.SetAttributeIfNotEmpty(HtmlTextWriterAttribute.Href, Href);
	}
}

